import { Avatar, Button, Grid, Paper, TextField } from '@material-ui/core';
import React from 'react';


const SignLog = ({email,setEmail,password,setPassword,handleLogin,handleSignUp,hasAcc,setHasAcc,emailError,passwordError}) => {

    const paperStyle = {padding:40, height:'70vh', width:300, margin:'30px auto'}
    const avatarStyle= {backgroundColor:'green'}

    return (
        <div>
            <Grid>
                <Paper elevation = {11} style = {paperStyle}>
                    <Grid align='center'>
                        <Avatar style={avatarStyle}></Avatar>
                        {/* <div style={{color:'red',fontsize:'3px'}}>{errMsg}</div>  */}
                        <h2>Sign In</h2>
                        <TextField required 
                        label="Username" 
                        placeholder="Enter Username OR Phone number"
                        value = {email}
                        onChange={(e)=> setEmail(e.target.value)}
                        />
                        <p>{emailError}</p>
                        <TextField required
                        label="Password"
                        type="password"
                        placeholder="Enter Password"
                        value={password}
                        onChange={(e)=> setPassword(e.target.value)}

                        />
                        <p>{passwordError}</p>
                    </Grid>
                 <br></br>
                 <div >
                     {hasAcc ? (
                         <>
                            <Button onClick={handleLogin}
                                variant="contained"
                                color="primary" 
                                disableElevation

                            >
                            Sign In
                            </Button>
                            <p>can`t have an account ? <span onClick={() => setHasAcc(!hasAcc)}>Sign up</span></p>
                         </>

                     ):(
                         <> 
                            <Button onClick={handleSignUp}
                                variant="contained"
                                color="primary" 
                                disableElevation

                            >
                            Sign up
                            </Button>
                            <p>Have an account ? <span onClick={() => setHasAcc(!hasAcc) }>Sign In</span></p>
                         </>

                     ) }

                 </div>

             </Paper>
            </Grid>
        </div>
    )
}

export default SignLog;
